import {RatedServiceName} from './ratedServiceName';
export const RatedServices = ({services=[],openPopup,hotel,isLoggedIn,userEmail})=>{

  const handleOnBtnClick =()=>{
        const rateHotel = {...hotel};
        localStorage.setItem("hotel",JSON.stringify(rateHotel));
        openPopup(true)
    }
    return(
            <div className='voted-services'>
                {services.map((vote)=>{
                return(
                    <div  key={vote.id} className='service'>
                        <RatedServiceName service={vote.service}/>
                        <p>{`(${vote.votes})`}</p>

                    </div>
                )
            })}
            {(email_verified)?<button className='votebtn' onClick={()=>handleOnBtnClick()} >How you treated?</button>:""}
            </div>

    );
}
